import React from 'react';
import { Button, FormControl, Input, FormControlLabel, Switch, TextField } from '@mui/material';

export default function form() {
    return (

        <FormControl>
          <TextField label="Name"/>


          <TextField label="Sobrenome"/>

          <TextField label="CPF"/>



            <label>Promocoes:
                <Input type="checkbox" />
            </label>

            <label>Novidades:
                <Input type="checkbox" />
            </label>

            <FormControlLabel control={<Switch defaultChecked />} label="liga" />

            <Button type="submit" variant="contained">Cadastrar</Button>
        </FormControl>
    )
}
